import React from 'react';

const Table = ({ data }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>Nama Barang</th>
          <th>Stok</th>
          <th>Jumlah Terjual</th>
          <th>Tanggal Transaksi</th>
          <th>Jenis Barang</th>
        </tr>
      </thead>
      <tbody>
        {data.map((item) => (
          <tr key={item.id}>
            <td>{item.nama_barang}</td>
            <td>{item.stok}</td>
            <td>{item.jumlah_terjual}</td>
            <td>{item.tanggal_transaksi}</td>
            <td>{item.jenis_barang}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default Table;
